import React from 'react';
import { Link } from 'react-router-dom';

const navLogoCont = {
    maxHeight: 'inherit', 
    height: 'inherit', 
    display: 'flex', 
    alignItems: 'center'
}

const navLogo = {
    margin: '0 0 .3vw 6vw',
    height: '4.35vw',
    maxHeight: '40px',
    minHeight: '23px',
}

// ------------
function Nav() {

    return (
        <header>
            <nav>
                <Link style={ navLogoCont } to='/'>
                    <img src="/images/navLogo.png" alt="CBSI" style={ navLogo } />
                </Link>
                <div></div>

            </nav>
        </header>
    );
}

export default HamburgerNav;
